import "../styles/Landing.css";
import eye from "./robotic-eye.png";

export default function Landing() {


  return (
     <div className="landing-container">

      {/* Text Section */}
      <div className="landing-content">
        <h1>FocusMate</h1>
        <p>Smart classroo Attention Monitoring System</p>

        {/* زر شكلي فقط */}
        <button>
         Start Monitoring
        </button>
      </div>

      {/* Eye + Beam */}
      <div className="landing-eye">
        <img src={eye} alt="robotic eye" />
        <div className="beam"></div>
      </div>

    </div>
  );
}
